import React, { useState } from 'react';
import './Register.css';

const CompanyRegistration = () => {
  const [form, setForm] = useState({
    name: '',
    industry: '',
    size: '',
    email: '',
    logo: null,
    documents: null,
  });
  const [message, setMessage] = useState({ type: '', text: '' });
  const [submitting, setSubmitting] = useState(false);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setForm((f) => ({ ...f, [name]: value }));
  };

  const handleFileChange = (e) => {
    const { name, files } = e.target;
    setForm((f) => ({ ...f, [name]: files[0] || null }));
  };

  const validate = () => {
    if (!form.name || !form.industry || !form.size || !form.email || !form.logo || !form.documents) {
      return 'Please complete all fields and upload both files.';
    }
    if (!/^\S+@\S+\.\S+$/.test(form.email)) {
      return 'Please enter a valid email address.';
    }
    return '';
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setMessage({ type: '', text: '' });
    const err = validate();
    if (err) {
      setMessage({ type: 'error', text: err });
      return;
    }

    setSubmitting(true);
    // simulate network delay
    setTimeout(() => {
      setSubmitting(false);
      // 90% chance success
      if (Math.random() < 0.9) {
        setMessage({ type: 'success', text: 'Company registered successfully!' });
        // reset form
        setForm({ name:'', industry:'', size:'', email:'', logo:null, documents:null });
      } else {
        setMessage({ type: 'error', text: 'Registration failed. Please try again.' });
      }
    }, 1000);
  };

  return (
    <div className="company-registration">
      <h2>Company Registration</h2>
      <form className="registration-form" onSubmit={handleSubmit} noValidate>
        <div className="form-group">
          <label>Company Name</label>
          <input
            type="text"
            name="name"
            value={form.name}
            onChange={handleInputChange}
            placeholder="e.g. Acme Corp"
          />
        </div>

        <div className="form-group">
          <label>Industry</label>
          <input
            type="text"
            name="industry"
            value={form.industry}
            onChange={handleInputChange}
            placeholder="e.g. Technology"
          />
        </div>

        <div className="form-group">
          <label>Company Size</label>
          <select name="size" value={form.size} onChange={handleInputChange}>
            <option value="">Select size</option>
            <option value="1-10">1â€“10 employees</option>
            <option value="11-50">11â€“50 employees</option>
            <option value="51-200">51â€“200 employees</option>
            <option value="200+">200+ employees</option>
          </select>
        </div>

        <div className="form-group file-group">
          <label>Company Logo</label>
          <input
            type="file"
            name="logo"
            accept="image/*"
            onChange={handleFileChange}
          />
        </div>

        <div className="form-group">
          <label>Official Company Email</label>
          <input
            type="email"
            name="email"
            value={form.email}
            onChange={handleInputChange}
            placeholder="you@company.com"
          />
        </div>

        <div className="form-group file-group">
          <label>Verification Documents</label>
          <input
            type="file"
            name="documents"
            onChange={handleFileChange}
          />
        </div>

        <button
          type="submit"
          className="button-primary"
          disabled={submitting}
        >
          {submitting ? 'Submittingâ€¦' : 'Register'}
        </button>
      </form>

      {message.text && (
        <div className={`form-message ${message.type}`}>
          {message.text}
        </div>
      )}
    </div>
  );
};

export default Register;
